script: |
  super -f text -I q1305.spq | sort > q1305.out

inputs:
  - name: q1305.spq
    data: |
      SELECT col0 / 27 - - 83 FROM tab0 (FORMAT parquet) WHERE NOT col2 NOT BETWEEN ( col0 / + col2 ) AND 94 * + col2;
  - name: tab0

outputs:
  - name: q1305.out
    data: |
      83
      86
      86
